import Vue from "vue";
import moment from "moment";
import { moneyShow } from "../utils/FuncHelpers";
Vue.filter("real", (value) => moneyShow(value) || "");
Vue.filter("moment", (date) => moment(date).format("DD/MM/YYYY HH:mm:ss") || "");
Vue.filter("dateMoment", (date) => moment(date).format("DD/MM/YYYY") || "");
Vue.filter("timeMoment", (date) => moment(date).format("HH:mm:ss") || "");
